import React from "react";
import styled from "styled-components";

import FacebookIcon from "@material-ui/icons/Facebook";

function SingUp() {
  return (
    <Wrapper>
      <PageTitle>
        <span>bitermoscoffe</span>
      </PageTitle>

      <SingUpContainer>
        <div className="withSocialMedia">
          <div className="title">
            <span>Sosyal medya ile Ã¼ye ol</span>
          </div>
          <div className="socialMediaIcon">
            <div className="facebookIcon">
              <img
                src="https://i.pinimg.com/736x/ac/57/3b/ac573b439cde3dec8ca1c6739ae7f628.jpg"
                alt="facebookIcon"
              />
              <div>
              <span>
              Facebook
              </span>
              </div>

            </div>
            <div className="googleIcon">
              <img
                src="https://img-authors.flaticon.com/google.jpg"
                alt="googleIcon"
              />
            </div>
          </div>
        </div>
        <div className="withEmailPassaword">
          <span>Passwprod</span>
        </div>
      </SingUpContainer>
    </Wrapper>
  );
}
const Wrapper = styled.div`
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;

  flex-direction: column;

  max-width: 472px;
  width: 100%;
  margin: 60px auto;
  color: #484848;
`;

const PageTitle = styled.div`
  span {
    font-size: xx-large;
    font-weight: 700;
    color: #6f4e37;
  }
`;

const SingUpContainer = styled.div`
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;

  flex-direction: column;
  padding: 72px;
  border: 1px solid #e5e5e5;
  border-radius: 8px;
  max-width: 472px;
  width: 100%;
  margin: 50px auto;
  color: #484848;
  .withSocialMedia {
    .socialMediaIcon {
      display: flex;
      flex-direction: row;
      margin-top:18px;
      margin-bottom:18px;
      justify-content:space-evenly;

      .googleIcon,
      .facebookIcon {
          display:flex;

          justify-content:center;
          align-content:center;


         height:100%;
          border:1px solid lightgray;

        img {
      padding-left:5px;


          width: 50px;
          height: 50px;
        }
      }
    }
  }
`;

export default SingUp;
